import React, { Fragment } from "react";
import { Card, Icon, Avatar, Row, Col } from "antd";

const { Meta } = Card;

const ReservationList = ({ data, onDelete, onEdit }) => {
  return (
    <Fragment>
      <Row>
        {data.map(card => (
          <Col key={key.index} span={6}>
            <Card
              style={{ margin: "2 0", width: "300px" }}
              key={card.id}
              title={`Table Number ${card.tableNumber}`}
              cover={<img alt="" src={card.url} />}
              actions={[
                <Icon type="delete" onClick={() => onDelete(card.id)} />,
                <Icon type="edit" onClick={() => onEdit(card)} />
              ]}
            >
              <Meta
                avatar={<Avatar>{card.usernameValue}</Avatar>}
                title={`Reserved Seats ${card.seats}`}
                description={`Ordered Date: ${card.date}`}
              />
            </Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default ReservationList;
